CREATE TABLE zaasmis.dbo.XTMK (
  MOK_ID NUMERIC(19) PRIMARY KEY NOT NULL,
  MOKMC VARCHAR(20),
  DANW_ID NUMERIC(19),
  MOKLJ VARCHAR(50),
  MOKZT VARCHAR(10),
  FUMKID NUMERIC(19),
  SHUOM VARCHAR(50),
  BEIZ VARCHAR(50),
  JILCJZ NUMERIC(19) NOT NULL,
  JILCJSJ DATETIME NOT NULL,
  JILXGZ NUMERIC(19) NOT NULL,
  JILXGSJ DATETIME NOT NULL,
  TIJR_ID VARCHAR(1000),
  SHENGHR_ID VARCHAR(1000),
  JIAOYR_ID VARCHAR(1000),
  FOREIGN KEY (FUMKID) REFERENCES XTMK (MOK_ID)
);

